using System;
using System.Collections.Generic;
using System.Linq;
using System.Net;
using System.Net.Http;
using System.Web.Http;

namespace RotaSPA_Client.Controllers
{
    public class KullaniciController : ApiController
    {
        public IHttpActionResult GetProfile()
        {
            var companyId = Request.Headers.GetValues("Current-RoleId").FirstOrDefault();
            var companies = new[]
            {
                new {Id = 1, companyName = "Arkas Lojistik - Halkapınar",roleId=1},
                new {Id = 2, companyName = "Ardep - Sütçüler Depo",roleId=2}
            };

            return Ok(new { companies, imageUri = "data:image/PNG;base64," });
        }
    }
}